(iteration, deopt) {
        let sum = 0n;
        for (const time of time_table) {
            sum += time;
        }
        const mean_time = parseInt(sum) / time_table.length;
        console.log("\x1b[32mmean time", mean_time, "\x1b[0m");
        storage[iteration] = {
            mean_time,
            deopt
        };
        if (mean_time < 100) {
            if (try_to_deopt) {
                deopt_objects.shift();
            }
            try_to_deopt = true;
        } else {
            try_to_deopt = false;
        }
    }

